import React from 'react';
import {NavLink} from 'react-router-dom';

const Errorpage=()=>{
    return(
        <>
        <h1>4010 Error</h1>
        <p>Sorry! Page not found</p>
        <NavLink to='/'>Go Back</NavLink>
        </>
    )
}

export default Errorpage;
